import React from 'react'

export default class extends React.Component {
  stuff = new Array(100).fill().map((v, i) => {
    return <p key={i}>hi{i}</p>
  })

  render () { return (
    <div class="my-4 bg-green-500">
      {this.stuff}
    </div>
  ) }
}
